import './App.css';
import Layout from './ChooseGlasses/Layout';
function App() {
  return (
    <div
      className="App"
      style={{
        height: "100vh",
        background: rgba(0, 0, 0, 0.5),
      }}
    >
      <Layout></Layout>
    </div>
  );
}

export default App;
